import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useLocation, useNavigate } from 'react-router-dom';

function TaskersList() {
  const [taskers, setTaskers] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [isPanelOpen, setIsPanelOpen] = useState(false);
  const [selectedTasker, setSelectedTasker] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();
  const serviceId = location.state?.serviceId;

  // Fetch taskers data
  useEffect(() => {
    const fetchTaskers = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/Tasker/Taskers', {
          params: { serviceId },
        });
        setTaskers(response.data);
      } catch (error) {
        console.error('Error fetching taskers:', error);
      }
    };

    if (serviceId) {
      fetchTaskers();
    }
  }, [serviceId]);

  // Handle booking action
  const handleBookTasker = (tasker) => {
    sessionStorage.setItem('taskerId', tasker.tasker_Profile_Id);
    sessionStorage.setItem('hourlyRate', tasker.hourlyRate);
    navigate('/payment', { state: { taskerId: tasker.tasker_Profile_Id } });
  };

  // Handle next and previous slide
  const handleNext = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % taskers.length); // Loop to the first image when reaching the end
  };

  const handlePrevious = () => {
    setCurrentIndex((prevIndex) =>
      prevIndex === 0 ? taskers.length - 1 : prevIndex - 1
    ); // Loop to the last image when reaching the beginning
  };

  // Auto-slide images every 3 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      handleNext();
    }, 3000); // 3000 ms = 3 seconds
    return () => clearInterval(interval); // Cleanup interval on component unmount
  }, [taskers.length]);

  return (
    <div className="flex justify-center items-center min-h-screen bg-gradient-to-r from-blue-100 via-indigo-100 to-pink-100">
      <div className="w-full max-w-4xl bg-white p-8 rounded-lg shadow-xl">
        <h1 className="text-3xl font-bold text-center text-gray-800 mb-6">Available Taskers</h1>

        {/* Image Carousel */}
        <div className="relative">
          {/* Carousel Images */}
          <div
            className="flex transition-transform duration-500 ease-in-out"
            style={{
              transform: `translateX(-${currentIndex * 100}%)`, // Shift images left based on the current index
            }}
          >
            {taskers.length > 0 ? (
              taskers.map((tasker, index) => (
                <div key={tasker.tasker_Profile_Id} className="flex-shrink-0 w-full">
                  <img
                    src={`http://localhost:5000/${tasker.taskerImage}`}
                    alt={`Tasker ${tasker.taskerName}`}
                    className="w-full h-64 object-cover rounded-lg"
                  />
                </div>
              ))
            ) : (
              <p>No taskers available</p>
            )}
          </div>

          {/* Navigation Buttons */}
          <button
            onClick={handlePrevious}
            className="absolute top-1/2 left-0 transform -translate-y-1/2 bg-gray-700 text-white px-4 py-2 rounded-full hover:bg-gray-800 focus:outline-none"
          >
            &#8249;
          </button>
          <button
            onClick={handleNext}
            className="absolute top-1/2 right-0 transform -translate-y-1/2 bg-gray-700 text-white px-4 py-2 rounded-full hover:bg-gray-800 focus:outline-none"
          >
            &#8250;
          </button>
        </div>

        {/* Taskers List */}
        <div className="taskers-container grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 mt-8">
          {taskers.length > 0 ? (
            taskers.map((tasker) => (
              <div
                key={tasker.tasker_Profile_Id}
                className="tasker-card bg-white p-4 rounded-lg shadow-lg transition transform hover:scale-105 hover:shadow-2xl"
              >
                <img
                  src={`http://localhost:5000/${tasker.taskerImage}`} // Tasker Image
                  alt={`${tasker.taskerName}'s profile`}
                  className="tasker-image w-full h-48 object-cover rounded-md mb-4"
                />
                <div>
                  <h2 className="text-xl font-semibold text-gray-800">{tasker.taskerName}</h2>
                  <p className="text-gray-600 mt-2">Experience: {tasker.experience} years</p>
                  <p className="text-gray-600">Hourly Rate: ${tasker.hourlyRate}</p>
                  <button
                    onClick={() => handleBookTasker(tasker)}
                    className="book-button mt-4 w-full bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 transition duration-300"
                  >
                    Book Now
                  </button>
                </div>
              </div>
            ))
          ) : (
            <p className="text-gray-500 text-center col-span-full">No taskers available.</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default TaskersList;
